import Link from "next/link";
import React from "react";
import GetData from "../modules";

export default function Categories() {
  return (
    <GetData
      query={`
    query {
      allCategories {
        name
      }
    }
  `}
    >
      {({ data }) => <pre>{JSON.stringify(data)}</pre>}
    </GetData>
  );
}
